(function() {
  var LTConsoleView;

  module.exports = LTConsoleView = (function() {
    function LTConsoleView(serializedState) {
      var font, fontSize, panelHeading;
      console.log("Constructing LTConsoleView");
      font = atom.config.get("editor.fontFamily");
      if (font === "") {
        font = "Lucida Console, Consolas, monospace";
      }
      fontSize = Math.round(atom.config.get("editor.fontSize") * 0.9);
      console.log(font, fontSize);
      this.panel = document.createElement('div');
      this.panel.classList.add('inset-panel');
      panelHeading = document.createElement('div');
      panelHeading.classList.add('panel-heading');
      panelHeading.innerHTML = "<strong>LaTeXTools Console</strong>";
      this.panel.appendChild(panelHeading);
      this.element = document.createElement('div');
      this.element.classList.add('panel-body', 'padded');
      this.element.style.fontSize = "125%";
      this.element.style.height = "" + ((5 + 1) * fontSize * 1.25) + "px";
      this.element.style.overflow = "scroll";
      this.panel.appendChild(this.element);
      true;
    }

    LTConsoleView.prototype.serialize = function() {};

    LTConsoleView.prototype.destroy = function() {
      return this.panel.remove();
    };

    LTConsoleView.prototype.getElement = function() {
      return this.element;
    };

    LTConsoleView.prototype.getPanel = function() {
      return this.panel;
    };

    return LTConsoleView;

  })();

}).call(this);

